import React, { useState } from "react";

export default function Input() {
    const [value, setValue] = useState("");
    onChangeValue = (e) => {
        setValue(e.target.value)
    }
    return (
        <>
            <input placeholder="Введите"
                value={value}
                onChange={onChangeValue}
            />
        </>
    )
}
